import React from 'react';
import styled, { ThemeProvider, createGlobalStyle } from 'styled-components';

const GlobalStyle = createGlobalStyle`
  body {
    background-color: ${props => props.theme.body};
    color: ${props => props.theme.text};
    transition: all 0.5s linear;
  }
`;

const lightTheme = {
  body: '#ffffff',
  text: '#000000',
  buttonBackground: '#000000',
  buttonText: '#ffffff',
};

const darkTheme = {
  body: '#1b1b1d',
  text: '#ffffff',
  buttonBackground: '#ffffff',
  buttonText: '#000000',
};

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
`;

const Button = styled.button`
  background-color: ${props => props.theme.buttonBackground};
  color: ${props => props.theme.buttonText};
  border: none;
  padding: 10px 20px;
  margin-top: 20px;
  cursor: pointer;
  font-size: 1rem;
  border-radius: 5px;
`;

const Header = styled.h1`
  font-size: 2rem;
  margin-bottom: 10px;
`;

const SubHeader = styled.p`
  font-size: 1rem;
`;

const App = () => {
  const [theme, setTheme] = React.useState(lightTheme);

  const toggleTheme = () => {
    setTheme(theme === lightTheme ? darkTheme : lightTheme);
  };

  return (
    <div style={{  position: 'relative', background: '#101827'}}>
  <div style={{width: 891, height: 79, left: 515, top: 342, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 50, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word'}}>Questio와 면접을 준비해봐요</div>
  <div style={{width: 1165, height: 90, left: 378, top: 450, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 35, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>포트폴리오를 분석해서 면접을 도와드릴게요<br/>당신의 잠재력을 일깨워드릴게요</div>
  <div style={{width: 1920, height: 120, left: 0, top: 0, position: 'absolute', background: 'white'}}>
    <div style={{width: 1920, height: 120, left: 0, top: 0, position: 'absolute', background: '#1F2937'}} />
    <div style={{width: 139, height: 60, left: 46, top: 30, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 35, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word'}}>Questio</div>
  </div>
  <div style={{paddingLeft: 20, paddingRight: 20, paddingTop: 15, paddingBottom: 15, left: 888, top: 646, position: 'absolute', background: '#374151', borderRadius: 10, overflow: 'hidden', justifyContent: 'center', alignItems: 'center', gap: 10, display: 'inline-flex'}}>
    <div style={{textAlign: 'center', color: 'white', fontSize: 23, fontFamily: 'Inter', fontWeight: '500', wordWrap: 'break-word'}}>시작해보기</div>
  </div>
</div>
  );
};

export default App;
